// iframe-resizer.js
function loadIframeResizer() {
   
  
    var script = document.createElement('script');
    script.src = '/node_modules/@iframe-resizer/parent/index.umd.js';
    script.onload = function() {
      window.iFrameResize({
        license: 'xxxx',
        waitForLoad: true
      }, '#myIframe');
    };
    document.body.appendChild(script);
  }
  
  window.addEventListener('DOMContentLoaded', loadIframeResizer);
  